import React from "react";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Container from '@mui/material/Container';



function PageLogin() {
  return (
    <div>
      <Container sx={{display: 'flex',justifyContent: 'center',alignItems:'center',marginTop: '50%'}}>
      <Box sx={{display: 'flex',justifyContent: 'center',alignItems: 'center',width: "50%", height: "100%", background: "#e0e0e0" }}>
          <Typography variant="h6" gutterBottom>
            h1. Heading
          </Typography>
        </Box>
      </Container>
        
      
    </div>
  );
}

export default PageLogin;
